import React from 'react';

const Dashboard = () => {
  const styles = {
    container: {
      width: '100%',
      height: '100vh',
      display: 'flex',
      flexDirection: 'column',
      background: 'linear-gradient(to bottom right, #f0f4f8, #dbeafe)',
      fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif"
    },
    header: {
      textAlign: 'center',
      padding: '20px 0',
      backgroundColor: '#ffffff',
      boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
      borderBottom: '2px solid #3b82f6',
    },
    title: {
      fontSize: '28px',
      fontWeight: '700',
      color: '#1e3a8a',
      marginBottom: '6px'
    },
    subtitle: {
      fontSize: '16px',
      color: '#64748b'
    },
    dashboardContainer: {
      flex: 1,
      padding: '20px',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center'
    },
    iframe: {
      width: '100%',
      height: '100%',
      maxHeight: '85vh',
      border: 'none',
      borderRadius: '12px',
      boxShadow: '0 8px 24px rgba(0, 0, 0, 0.15)'
    }
  };

  const powerBiUrl = "https://app.powerbi.com/reportEmbed?reportId=f7a7df31-5087-43e4-aa18-2db86a75abde&autoAuth=true&ctid=dbd6664d-4eb9-46eb-99d8-5c43ba153c61";

  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h1 style={styles.title}>STB - Gestion des Tickets</h1>
        <p style={styles.subtitle}>Suivi en temps r√©el des tickets techniques</p>
      </header>

      <main style={styles.dashboardContainer}>
        <iframe 
          title="STB Tickets Dashboard" 
          style={styles.iframe}
          src={powerBiUrl}
          allowFullScreen
        />
      </main>
    </div>
  );
};

export default Dashboard;
